import "./Movie.css";
export default function Movie({
  movieOverview,
  movieRating,
  movieReleaseDate,
  moviePoster,
}) {
  return (
    <div
      style={{
        backgroundImage: `url("https://image.tmdb.org/t/p/w300/${moviePoster}")`,
      }}
      className="movie"
    >
      <label className="show-infos-click">
        <input className="input-click" type="checkbox"></input>
        More Infos
      </label>

      <p className="movie-rating">{movieRating}</p>
      <div className="show-infos">
        <p className="movie-release">{movieReleaseDate}</p>
        <p className="overview">{movieOverview}</p>
      </div>
    </div>
  );
}
